(2, '', 'Áo khoác nam TITISHOP AKN33 (Đen phối đỏ)', 'ao-khoac-nam-titishop-akn33-den-phoi-do', 'Chất liệu nỉ ngoại nhập. Kiểu áo khoác tay dài. Thiết kế hợp xu hướng. Size M Và L ( Gợi ý size M Phù hợp nam dưới 60kg size L phù hợp nam dưới 78kg )', '<h2 class="product-description__title" style="margin: 0px 0px 17px; padding: 0px; font-weight: 700; font-size: 16px; line-height: 2.4rem; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif;">Giới thiệu sản phẩm &Aacute;o kho&aacute;c nam TITISHOP AKN33 (Đen phối đỏ)</h2>\r\n\r\n<div class="product-description__webyclip-thumbnails" style="margin: 0px 0px 15px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;">\r\n<div class="webyclip-thumbnails" id="webyclip_thumbnails" style="margin: 0px; padding: 0px;">&nbsp;</div>\r\n</div>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;">Một chiếc &aacute;o kho&aacute;c hợp xu hướng l&agrave; trang phục g&oacute;p phần t&ocirc;n vinh n&eacute;t nam t&iacute;nh của c&aacute;c ch&agrave;ng trai hiện đại v&agrave; trẻ trung. Sở hữu phom d&aacute;ng đ&uacute;ng chuẩn c&ugrave;ng thiết kế năng động, khỏe khoắn Với &aacute;o kho&aacute;c nam AKN33 l&agrave; một lựa chọn l&yacute; tưởng d&agrave;nh cho bạn. B&ecirc;n cạnh đ&oacute;, với chất liệu nỉ cộng th&ecirc;m sự kết hợp tinh tế của hai gam m&agrave;u x&aacute;m - đen, &aacute;o c&oacute; thể mix c&ugrave;ng nhiều phục trang kh&aacute;c nhau. Chỉ cần th&ecirc;m một chiếc &aacute;o thun mặc b&ecirc;n trong c&ugrave;ng quần jeans đơn giản, bạn đ&atilde; c&oacute; một set đồ ho&agrave;n chỉnh để xuống phố c&ugrave;ng bạn b&egrave;.</p>\r\n\r\n<div style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">ĐẶC ĐIỂM NỔI BẬT</span></div>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Chất liệu NỈ&nbsp;</span>NGOẠI NHẬP<br style="margin: 0px; padding: 0px;" />\r\n&Aacute;o được may từ chất liệu nỉ d&agrave;y dặn, mềm mại, tạo cảm gi&aacute;c dễ chịu v&agrave; thoải m&aacute;i cho người mặc.</p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Kiểu d&aacute;ng hợp xu hướng</span><br style="margin: 0px; padding: 0px;" />\r\nSở hữu thiết kế đơn giản nhưng hợp xu hướng, sản phẩm t&ocirc;n vinh n&eacute;t đẹp nam t&iacute;nh của c&aacute;c ch&agrave;ng trai hiện đại v&agrave; trẻ trung.</p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Ph&ugrave; hợp mix c&ugrave;ng nhiều trang phục v&agrave; phụ kiện</span><br style="margin: 0px; padding: 0px;" />\r\nVới gam m&agrave;u trung t&iacute;nh, bạn c&oacute; thể dễ d&agrave;ng mix &aacute;o c&ugrave;ng nhiều trang phục v&agrave; phụ kiện kh&aacute;c để l&agrave;m nổi bật phong c&aacute;ch của ch&iacute;nh m&igrave;nh.</p>\r\n', 'Áo khoác nam TITISHOP AKN33 (Đen phối đỏ)', 'ao-khoac-nam-titishop-akn33-den-phoi-do', 'Chất liệu nỉ ngoại nhập. Kiểu áo khoác tay dài. Thiết kế hợp xu hướng. Size M Và L ( Gợi ý size M Phù hợp nam dưới 60kg size L phù hợp nam dưới 78kg )', '<h2 class="product-description__title" style="font-weight: 700; line-height: 2.4rem; margin: 0px 0px 17px; padding: 0px; font-size: 16px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif;">Giới thiệu sản phẩm &Aacute;o kho&aacute;c nam TITISHOP AKN33 (Đen phối đỏ)</h2>\r\n\r\n<div class="product-description__webyclip-thumbnails" style="margin: 0px 0px 15px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;">\r\n<div class="webyclip-thumbnails" id="webyclip_thumbnails" style="margin: 0px; padding: 0px;">&nbsp;</div>\r\n</div>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;">Một chiếc &aacute;o kho&aacute;c hợp xu hướng l&agrave; trang phục g&oacute;p phần t&ocirc;n vinh n&eacute;t nam t&iacute;nh của c&aacute;c ch&agrave;ng trai hiện đại v&agrave; trẻ trung. Sở hữu phom d&aacute;ng đ&uacute;ng chuẩn c&ugrave;ng thiết kế năng động, khỏe khoắn Với &aacute;o kho&aacute;c nam AKN33 l&agrave; một lựa chọn l&yacute; tưởng d&agrave;nh cho bạn. B&ecirc;n cạnh đ&oacute;, với chất liệu nỉ cộng th&ecirc;m sự kết hợp tinh tế của hai gam m&agrave;u x&aacute;m - đen, &aacute;o c&oacute; thể mix c&ugrave;ng nhiều phục trang kh&aacute;c nhau. Chỉ cần th&ecirc;m một chiếc &aacute;o thun mặc b&ecirc;n trong c&ugrave;ng quần jeans đơn giản, bạn đ&atilde; c&oacute; một set đồ ho&agrave;n chỉnh để xuống phố c&ugrave;ng bạn b&egrave;.</p>\r\n\r\n<div style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">ĐẶC ĐIỂM NỔI BẬT</span></div>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Chất liệu NỈ&nbsp;</span>NGOẠI NHẬP<br style="margin: 0px; padding: 0px;" />\r\n&Aacute;o được may từ chất liệu nỉ d&agrave;y dặn, mềm mại, tạo cảm gi&aacute;c dễ chịu v&agrave; thoải m&aacute;i cho người mặc.</p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Kiểu d&aacute;ng hợp xu hướng</span><br style="margin: 0px; padding: 0px;" />\r\nSở hữu thiết kế đơn giản nhưng hợp xu hướng, sản phẩm t&ocirc;n vinh n&eacute;t đẹp nam t&iacute;nh của c&aacute;c ch&agrave;ng trai hiện đại v&agrave; trẻ trung.</p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Ph&ugrave; hợp mix c&ugrave;ng nhiều trang phục v&agrave; phụ kiện</span><br style="margin: 0px; padding: 0px;" />\r\nVới gam m&agrave;u trung t&iacute;nh, bạn c&oacute; thể dễ d&agrave;ng mix &aacute;o c&ugrave;ng nhiều trang phục v&agrave; phụ kiện kh&aacute;c để l&agrave;m nổi bật phong c&aacute;ch của ch&iacute;nh m&igrave;nh.</p>\r\n', 'http://localhost:81/admin/public/uploads/images/san-pham/ao-khoac/ao-khoac-nam-titishop-akn33-den-phoi-do-2459-307352-1-catalog_233.jpg', '', 'http://localhost:81/admin/public/uploads/images/san-pham/ao-khoac/ao-khoac-nam-titishop-akn33-den-phoi-do-2459-307352-1-catalog_233.jpg||http://localhost:81/admin/public/uploads/images/san-pham/ao-khoac/ao-khoac-nam-titishop-akn33-den-phoi-do-2459-307352-1-catalog_233.jpg||http://localhost:81/admin/public/uploads/images/san-pham/ao-khoac/ao-khoac-nam-titishop-akn33-den-phoi-do-2459-307352-1-catalog_233.jpg', 25, NULL, 400000, 219000, NULL, 100, NULL, 0, 0, 1462358945, 1462358945, 1, 0, 1, 0, 0, 0, 1, 1, 1);
