(71, NULL, 'Áo khoác color xỏ ngón', 'ao-khoac-color-xo-ngon', 'Áo khoác nữ xỏ ngón thời trang, cá tính giúp bảo vệ làn da của bạn, tôn nét năng động và thời trang', '<p>&Aacute;o kho&aacute;c nữ xỏ ng&oacute;n thời trang, c&aacute; t&iacute;nh gi&uacute;p bảo vệ l&agrave;n da của bạn, t&ocirc;n n&eacute;t năng động v&agrave; thời trang</p>\n', 'Áo khoác color xỏ ngón', 'ao-khoac-color-xo-ngon', 'Áo khoác nữ xỏ ngón thời trang, cá tính giúp bảo vệ làn da của bạn, tôn nét năng động và thời trang', '<p>&Aacute;o kho&aacute;c nữ xỏ ng&oacute;n thời trang, c&aacute; t&iacute;nh gi&uacute;p bảo vệ l&agrave;n da của bạn, t&ocirc;n n&eacute;t năng động v&agrave; thời trang</p>\n', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/ao-khoac-color-xo-ngon.jpg', '', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_479148001461557388.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_410490001461557388.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_342523001461557388.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_120215001461557388.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/ao-khoac-color-xo-ngon.jpg', 16, NULL, 180000, 89000, NULL, NULL, NULL, 0, 5, 1465357874, 1465357874, 1, 0, 1, 0, 0, 0, 0, 1, 1),
(72, NULL, 'Áo khoác phối màu', 'ao-khoac-phoi-mau', 'Thiết áo có nón với 2 lớp vài dày dặn, tay dài, phối màu ở dây kéo và dây rút lạ mắt', '<p>Thiết &aacute;o c&oacute; n&oacute;n với 2 lớp v&agrave;i d&agrave;y dặn, tay d&agrave;i, phối m&agrave;u ở d&acirc;y k&eacute;o v&agrave; d&acirc;y r&uacute;t lạ mắt</p>\n', 'Áo khoác phối màu', 'ao-khoac-phoi-mau', 'Thiết áo có nón với 2 lớp vài dày dặn, tay dài, phối màu ở dây kéo và dây rút lạ mắt', '<p>Thiết &aacute;o c&oacute; n&oacute;n với 2 lớp v&agrave;i d&agrave;y dặn, tay d&agrave;i, phối m&agrave;u ở d&acirc;y k&eacute;o v&agrave; d&acirc;y r&uacute;t lạ mắt</p>\n', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/ao-khoac-phoi-mau.jpg', '', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_123820001463049059.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_021858001463049059.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/0_186102001463049059.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-khoat-nu/ao-khoac-phoi-mau.jpg', 16, NULL, 190000, 145000, NULL, NULL, NULL, 0, 3, 1465357968, 1465357968, 1, 0, 1, 0, 0, 0, 0, 1, 1),
