(88, NULL, 'Áo sơ mi nam tay ngắn cổ phối màu', 'ao-so-mi-nam-tay-ngan-co-phoi-mau', 'Dễ phối cùng các kiểu quần jeans, kaki để có bộ trang phục lịch sự, trẻ trung khi đi làm, đi tiệc và cả khi dạo phố, hẹn hò…', '<p>Dễ phối c&ugrave;ng c&aacute;c kiểu quần jeans, kaki để c&oacute; bộ trang phục lịch sự, trẻ trung khi đi l&agrave;m, đi tiệc v&agrave; cả khi dạo phố, hẹn h&ograve;&hellip;</p>\n', 'Áo sơ mi nam tay ngắn cổ phối màu', 'ao-so-mi-nam-tay-ngan-co-phoi-mau', 'Dễ phối cùng các kiểu quần jeans, kaki để có bộ trang phục lịch sự, trẻ trung khi đi làm, đi tiệc và cả khi dạo phố, hẹn hò…', '<p>Dễ phối c&ugrave;ng c&aacute;c kiểu quần jeans, kaki để c&oacute; bộ trang phục lịch sự, trẻ trung khi đi l&agrave;m, đi tiệc v&agrave; cả khi dạo phố, hẹn h&ograve;&hellip;</p>\n', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-somi-nam/ao-so-mi-nam-tay-ngan-den.jpg', '', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-somi-nam/0_360389001446193537.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-somi-nam/0_494741001446193537.jpg||http://localhost:81/admin/public/uploads/images/hinh-san-pham/ao-somi-nam/ao-so-mi-nam-tay-ngan-den.jpg', 18, NULL, 180000, 120000, NULL, NULL, NULL, 0, 11, 1465360579, 1465360579, 1, 0, 1, 0, 0, 0, 1, 1, 1),
(89, NULL, 'Quần jean nam thời trang', 'quan-jean-nam-thoi-trang', 'Thích hợp với nhiều Styles khác nhau có thể phối với nhiều loại trang phục, thích hợp cho mọi lứa tuổi, tạo nên phong cách năng động, thời trang cho bạn.', '<p>Th&iacute;ch hợp với nhiều Styles kh&aacute;c nhau c&oacute; thể phối với nhiều loại trang phục, th&iacute;ch hợp cho mọi lứa tuổi, tạo n&ecirc;n phong c&aacute;ch năng động, thời trang cho bạn.</p>\n', 'Quần jean nam thời trang', 'quan-jean-nam-thoi-trang', 'Thích hợp với nhiều Styles khác nhau có thể phối với nhiều loại trang phục, thích hợp cho mọi lứa tuổi, tạo nên phong cách năng động, thời trang cho bạn.', '<p>Th&iacute;ch hợp với nhiều Styles kh&aacute;c nhau c&oacute; thể phối với nhiều loại trang phục, th&iacute;ch hợp cho mọi lứa tuổi, tạo n&ecirc;n phong c&aacute;ch năng động, thời trang cho bạn.</p>\n', 'http://localhost:81/admin/public/uploads/images/Hydrangeas.jpg', '', 'http://localhost:81/admin/public/uploads/images/hinh-san-pham/quan-jean-nam/quan-jean-nam-thoi-trang.jpg', 19, NULL, 250000, 145000, NULL, NULL, NULL, 0, 8, 1465360740, 1493202468, 0, 0, 1, 0, 0, 0, 0, 1, 1),
